import React from 'react';
import '../styles/BusinessSolutionsPage.css';
import oneTimeUseImage from '../assets/one-time-use.jpg';
import businessSolutionsImage from '../assets/business-solutions.jpg';

function BusinessSolutionsPage() {
  return (
    <div className="business-solutions-page">
      <h1>Business Solutions</h1>
      <div className="solution">
        <img src={oneTimeUseImage} alt="One Time Use Solutions" />
        <h2>One Time Use Solutions</h2>
        <p>Tailored solutions for specific business needs.</p>
      </div>
      <div className="solution">
        <img src={businessSolutionsImage} alt="Regular Solutions" />
        <h2>Regular Solutions</h2>
        <p>Ongoing support to streamline business operations and ensure regulatory compliance.</p>
      </div>
      <div className="solution">
        <img src={oneTimeUseImage} alt="Blockchain Technology" />
        <h2>Blockchain Technology</h2>
        <p>Integrating blockchain for secure and transparent transactions.</p>
      </div>
    </div>
  );
}

export default BusinessSolutionsPage;
